package com.kh.data;

public class TestCasting
{
    
    public static void main(String[] args)
    {
        // TODO Auto-generated method stub
        long longVal = 100L;
        int intVal = (int)longVal;
        
        System.out.println(intVal);
        
        double dValue = 123.5;
        int iValue = (int)dValue;
        
        System.out.println(iValue);
    }
    
}
